import React from 'react'
import CardFilter from '../cardcomponent/CardFilter'

function Report() {
  return (
    <div className="card">
        <CardFilter filterChange={handleFilterChnage} />
        <div className='card-body'>
            <h5 className='card-title'>Report <span></span></h5>
        </div>
    </div>
  )
}

export default Report
